import React from "react";
import styled from "styled-components";

const Card = () => {
  return (
    <div>
      <img
        src="https://cdn.dribbble.com/users/2400293/screenshots/16630840/media/ed6af0d38d460ff9ee426ad69e6435ea.png?compress=1&resize=400x300&vertical=top"
        alt=""
      />
      <div>
        <div>
          <div>
            <img
              src="https://cdn.dribbble.com/users/2400293/screenshots/14988700/media/5fd7eb67da21caa45eb864fbc27f24a2.jpg?compress=1&resize=1000x750&vertical=top"
              alt=""
            />
            <span>@toilatofu</span>
          </div>
          <div>256</div>
        </div>
        <div></div>
      </div>
    </div>
  );
};

export default Card;
